import React from 'react';

//import './Imagenes.css';

const Imagenes = ({ classStyle, imageSrc, imageAlt }) => (
	<div className={`${classStyle}`}>
        <img src={imageSrc} alt={imageAlt} />
    </div>
);

export default Imagenes;
